var images = [
  '',
  '',
  '',
  '',
  '',
  ''
]

images.forEach((image, index) => {
  setTimeout(() => {
    var elem = document.querySelector('.image' + (index + 1));
    elem.style.backgroundImage = `url(data:image/png;base64,${image})`;
    elem.classList.add('image--displayed');
  }, Math.random() * 2000 + 500)
});